            Page.GMapInit = function () {
                Page.GMap = new google.maps.Map(document.getElementById('gmap'), {
                    center: {lat: -1.538286, lng: 118.352141},
                    zoom: 5,
                    mapTypeControl: false,
                    streetViewControl: false
                });
                var urlGeoJson = 'https://simas.kemenag.go.id/maps/indonesia.geojson';
                Page.GMapLoadGeoJson(urlGeoJson, null);
                Page.GMapSetStyles();
                Page.GMapCluster = new MarkerClusterer(null, []);
            }
            Page.GMapSetStyles = function () {
                Page.GMap.data.setStyle({
                    fillColor: '#8da03c',
                    strokeWeight: 0.7,
                    strokeColor: '#296023',
                });
                Page.GMap.data.addListener('mouseover', function (event) {
                    var info = event.feature.j;
                    if (info.state != undefined) {
                        injectTooltip(event, info);
                    }
                    Page.GMap.data.overrideStyle(event.feature, {fillColor: '#db6331'});
                });
                Page.GMap.data.addListener('mouseout', function (event) {
                    deleteTooltip(event);
                    Page.GMap.data.overrideStyle(event.feature, {fillColor: '#8da03c'});
                });
            }
            Page.GMapLoadGeoJson = function (url, options) {
                var harapan = new Promise(function (resolve, reject) {
                    try {
                        Page.GMap.data.loadGeoJson(url, options, function (features) {
                            resolve(features);
                        });
                    } catch (e) {
                        reject(e);
                    }
                });

                return harapan;
            }
            Page.GMapDrawMasjidMarker = function (param) {
                if (param == undefined) {
                    param = {tipe: '', tipologi: '', prov: '', kab: '', kec: ''};
                }
                $.ajax({
                    url: 'https://simas.kemenag.go.id/start/getmapmarkers',
                    data: param,
                    method: 'POST',
                    success: function (data) {
                        Page.GMapBuildMarker(data);
                    }
                });
            }
            Page.GMapReset = function () {
                Page.GMapClearAllMarkers();

                var pt = new google.maps.LatLng(-1.538286, 118.352141);
                Page.GMap.setCenter(pt);
                Page.GMap.setZoom(5);

                Page.GMapResetFilter();
            }
            Page.GMapBuildMarker = function (xml) {
                Page.GMapClearAllMarkers();
                var isCluster = $('#cbCluster').is(":checked");
                var customLabel = {
                    masjid: {
                        label: 'M'
                    },
                    mushalla: {
                        label: 'S'
                    }
                };
                var markers = xml.documentElement.getElementsByTagName('marker');
                var arrMarkers = Array.prototype.slice.call(markers);
                var dataCount = arrMarkers.length;

                var dataPerProcess = 1000;
                var take = 0;
                var limit = (dataCount < dataPerProcess ? dataCount : dataPerProcess);
                var counter = 0;
                var isFinish = false;
                // Page.GMapShowLoader();
                while (!isFinish) {
                    var dt = arrMarkers.slice(take, limit);
                    var dtcounter = take;
                    Array.prototype.forEach.call(dt, function (markerElem) {
                        var id = markerElem.getAttribute('id');
                        var name = markerElem.getAttribute('name');
                        var address = markerElem.getAttribute('address');
                        var type = markerElem.getAttribute('type');
                        var iconimg = markerElem.getAttribute('icon');
                        var point = new google.maps.LatLng(
                                parseFloat(markerElem.getAttribute('lat')),
                                parseFloat(markerElem.getAttribute('lng')));

                        var infowincontent = document.createElement('div');
                        var strong = document.createElement('strong');
                        strong.textContent = name
                        infowincontent.appendChild(strong);
                        infowincontent.appendChild(document.createElement('br'));

                        var text = document.createElement('text');
                        text.textContent = address
                        infowincontent.appendChild(text);
                        var icon = customLabel[type] || {};
                        var marker = new google.maps.Marker({
                            map: (isCluster ? null : Page.GMap),
                            position: point,
                            icon: {url: Page.GMapMarkerIcon[iconimg]["icon"], scaledSize: new google.maps.Size(24, 33)},
                        });

                        var contentString = '<div class="marker-info">' +
                                '<h4>' + name + '</h4>' +
                                '<p>' + address + '</p>' +
                                '<p><a href="https://simas.kemenag.go.id/profil/masjid/' + id + '" class="btn btn-sm btn-info">Lihat Profil</a></p>' +
                                '</div>';
                        var infowindow = new google.maps.InfoWindow({
                            content: contentString
                        });
                        marker.addListener('click', function () {
                            infowindow.open(Page.GMap, marker);
                        });
                        Page.GMapMarkers.push(marker);

                        dtcounter++;
                        if (dtcounter % dataPerProcess == 0 || dtcounter == dataCount) {
                            var pct = dtcounter / dataCount * 100;
                            if (pct <= 100) {
                                Page.GMapSetProgress(pct);
                            }
                        }
                    });

                    counter++;
                    take = counter * dataPerProcess;
                    limit = ((counter + 1) * dataPerProcess);

                    // console.log(counter + ':' + take + ':' + limit + ':' + dataCount);

                    if (limit > dataCount) {
                        isFinish = true;
                    }
                }
                if (isCluster) {
                    Page.GMapCluster = new MarkerClusterer(Page.GMap, Page.GMapMarkers,
                            {imagePath: 'https://developers.google.com/maps/documentation/javascript/examples/markerclusterer/m'});
                }
                if (isFinish) {
                    Page.GMapHideLoader();
                }
            }
            Page.GMapShowCluster = function () {
                var isCluster = $('#cbCluster').is(":checked");
                Page.GMapShowLoader();
                if (isCluster) {
                    for (var i = 0; i < Page.GMapMarkers.length; i++) {
                        Page.GMapMarkers[i].setMap(null);
                    }
                    Page.GMapCluster = new MarkerClusterer(Page.GMap, Page.GMapMarkers,
                            {imagePath: 'https://developers.google.com/maps/documentation/javascript/examples/markerclusterer/m'});
                } else {
                    try {
                        Page.GMapCluster.setMap(null);
                        Page.GMapCluster.removeMarkers(Page.GMapMarkers);
                    } catch (e) {
                    }
                    for (var i = 0; i < Page.GMapMarkers.length; i++) {
                        Page.GMapMarkers[i].setMap(Page.GMap);
                    }
                }
                Page.GMapHideLoader();
            }
            Page.GMapClearAllMarkers = function () {
                try {
                    Page.GMapCluster.setMap(null);
                    Page.GMapCluster.removeMarkers(Page.GMapMarkers);
                } catch (e) {
                }
                for (var i = 0; i < Page.GMapMarkers.length; i++) {
                    Page.GMapMarkers[i].setMap(null);
                }
                Page.GMapMarkers = [];
            }
