                if (type == "") {
                    alert("Mohon pilih type masjid / mushalla!");
                    return;
                }
                var idprov = $("#propinsi").val() == "" ? "0" : $("#propinsi").val();
                var idkab = $("#kota").val() == "" ? "0" : $("#kota").val();
                var idkec = $("#kecamatan").val() == "" ? "0" : $("#kecamatan").val();
                var idtipologi = $("#tipologi").val() == "" ? "0" : $("#tipologi").val();
                var keyword = $("#keyword").val();
                if (type == "0") {
                    document.location.href = "https://simas.kemenag.go.id/page/search/masjid" + "/" + idprov + "/" + idkab + "/" + idkec + "/" + idtipologi + "/" + keyword;
                } else {
                    document.location.href = "https://simas.kemenag.go.id/page/search/mushalla" + "/" + idprov + "/" + idkab + "/" + idkec + "/" + idtipologi + "/" + keyword;
                }
            }

            var tipObj = null;
            var offset = {
                x: 20,
                y: 0
            };

            function injectTooltip(event, data) {
                if (!tipObj && event) {
                    var id = data.id_simas;
                    var state = data.state;
                    var dtSum = _.filter(dataSumMasjid, function (item) {
                        return item.provinsi_id == id
                    });
                    if ($('#gm-tipe').val() == '1') {
                        dtSum = _.filter(dataSumMushalla, function (item) {
                            return item.provinsi_id == id
                        });
                    }
                    var total = parseInt(0);
                    if (dtSum != undefined) {
                        if (dtSum.length > 0) {
                            total = parseInt(dtSum[0].total);
                        }
                    }
                    var formatter = new Intl.NumberFormat('id-ID');

                    //create the tooltip object
                    tipObj = document.createElement("div");
                    tipObj.style.width = 'auto';
                    tipObj.style.height = '40px';
                    tipObj.style.background = "white";
                    tipObj.style.borderRadius = "3px";
                    tipObj.style.padding = "10px";
                    tipObj.style.fontFamily = "inherit";
                    tipObj.style.fontWeight = "600";
                    tipObj.style.fontSize = "12px";
                    tipObj.style.textAlign = "center";
                    tipObj.innerHTML = '<h4 class="gmap-tips">' + state + '&nbsp;<span class="badge badge-success">' + formatter.format(parseInt(total.toFixed(0))) + '</span></h4>';

                    //position it
                    tipObj.style.position = "fixed";
                    try {
                        tipObj.style.top = event.tb.clientY + offset.y + "px";
                        tipObj.style.left = event.tb.clientX + offset.x + "px";
                    } catch (e) {
                    }

                    //add it to the body
                    document.body.appendChild(tipObj);
                }
            }

            function moveTooltip(event) {
                if (tipObj && event) {
                    //position it
                    tipObj.style.top = event.tb.clientY + window.scrollY + offset.y + "px";
                    tipObj.style.left = event.tb.clientX + window.scrollX + offset.x + "px";
                }
            }

            function deleteTooltip(event) {
                if (tipObj) {
                    //delete the tooltip if it exists in the DOM
                    try {
                        document.body.removeChild(tipObj);
                    } catch (e) {
                    }
                    tipObj = null;
                }
            }

            function reformatNumber(num) {
                // num = Math.round(num);
                num = num.toString().replace(/\Rp.|\,/g, '').replace(/\,00|\,/g, '').replace(/\.|\,/g, '');
                // No error checking. Assumes only ever 1 DP per number
                var text = num;

                //added by masmeka
                var minPos = text.indexOf('-');
                var isMin = (minPos > -1);

                text = text.replace('-', '');

                // Strip off anything to the right of the DP
                var rightOfDp = '';
                var dpPos = text.indexOf(',');
                if (dpPos != -1) {
                    rightOfDp = text.substr(dpPos);
                    text = text.substr(0, dpPos);
                }

                var inttext = parseInt(text);
                if (inttext <= 0) {
                    return "0";
                }

                var leftOfDp = '';
                var counter = 0;
                // Format the remainder into 3 char blocks, starting from the right
                for (var loop = text.length - 1; loop > -1; loop--) {
                    var c = text.charAt(loop);

                    // Ignore existing dot
                    if (c == '.')
                        continue;

                    leftOfDp = c + leftOfDp;
                    counter++;
                    if (counter % 3 == 0)
                        leftOfDp = '.' + leftOfDp;
                }

                // Strip leading space if present
                if (leftOfDp.charAt(0) == '.')
                    leftOfDp = leftOfDp.substr(1);

                return (isMin ? '-' : '') + leftOfDp + rightOfDp;
            }
        </script>
